css:
.git-control .dialog {
  position: absolute;
  bottom: -20%;
  right: 20%;
  left: 20%;
  background: #ffffff;
  border: 1px solid rgba(159, 159, 159, 0.9);
  border-radius: 4px;
  padding: 15px;
  opacity: 0.95;
  display: none;
  z-index: 10;
}
.git-control .dialog.active {
  display: block;
}
.git-control .dialog .body {
  margin-bottom: 15px;
}
.git-control .dialog .heading {
  margin-bottom: 15px;
}
.git-control .dialog .heading strong {
  color: #000000;
  display: inline-block;
}
.git-control .dialog .heading i.icon {
  float: right;
  width: 0;
  margin-right: 15px;
}
.git-control .dialog input,
.git-control .dialog select,
.git-control .dialog textarea {
  width: 100%;
  margin-bottom: 15px;
  background: #ffffff;
  border-color: rgba(159, 159, 159, 0.9);
  border-radius: 4px;
  color: #444444;
  padding: 10px;
}
.git-control .dialog .checkbox {
  width: 5%;
  display: inline;
  vertical-align: -30%;
}
.git-control .dialog input[readonly],
.git-control .dialog textarea[readonly],
.git-control .dialog select[readonly] {
  color: #999999;
}
.git-control .dialog select {
  -webkit-appearance: none;
  -moz-appearance: none;
  appearance: none;
}
.git-control .dialog textarea {
  height: 150px;
  resize: none;
}
.git-control .dialog textarea.over-fifty {
  color: #cc0000;
}
.git-control .dialog button {
  background: transparent;
  border: 1px solid transparent;
  border-radius: 4px;
  color: #444444;
  margin-right: 10px;
}
.git-control .dialog button:hover {
  color: #000000;
}
